import React, { Component }  from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component{
  constructor() {
    super();
    this.state = {
      monsters:[
        {
          name: 'Frankenstein'
        },
        {
          name: 'Dracula'
        },
        {
          name: 'Wolf'
        },
      ]
    }


  }

  render() {
    return(
      <div className="App">
      {
        this.state.monsters.map( monster => {monster.name})
      }
    </div>
    );
  }

}


export default App;
